import React from 'react';
import './App.css';
import Adress from './Component/Profile/Adress.js';
import FullName from './Component/Profile/FullName.js';
import ProfilePhoto from './Component/Profile/ProfilePhoto.js';

function App() {
  return (
    <>
    <div className="card">
    <ProfilePhoto/>

    <Adress/> <FullName/>
</div>
</>
  );
}

export default App;
